        expect($m).to.have.text('There was an error uploading the file. Please ensure the file is a .pdf, .jpg, .png, or other image file and try again.');
        expect($m).to.have.css('background-color', 'rgb(255, 232, 230)');
      }).then(function ($el) {
        signinElements.customerPage.uploadfiles().attachFile('testPicture.png', {
          subjectType: 'drag-n-drop'
        }); //Validate Success Message
        signinElements.customerPage.getsuccessmessage().invoke('text').then(function (text) {
          expect(text).to.equals('Got it!');
        });
        signinElements.customerPage.getforwardbutton().click().then(function ($el) {
          signinElements.customerPage.uploadfiles().attachFile('example.json', {
